Provides a convenient method for performing basic date arithmetic. This method
does not modify the Date instance being called - it creates and returns
a new Date instance containing the resulting date value.

Examples:

    // Basic usage:
    var dt = Ext.Date.add(new Date('10/29/2006'), Ext.Date.DAY, 5);
    console.log(dt); // returns 'Fri Nov 03 2006 00:00:00'

    // Negative values will be subtracted:
    var dt2 = Ext.Date.add(new Date('10/1/2006'), Ext.Date.DAY, -5);
    console.log(dt2); // returns 'Tue Sep 26 2006 00:00:00'

     // Decimal values can be used:
    var dt3 = Ext.Date.add(new Date('10/1/2006'), Ext.Date.DAY, 1.25);
    console.log(dt3); // returns 'Mon Oct 02 2006 06:00:00'

Creates and returns a new Date instance with the exact same date value as the called instance.
Dates are copied and passed by reference, so if a copied date variable is modified later, the original
variable will also be changed.  When the intention is to create a new variable that will not
modify the original instance, you should create a clone.

Example of correctly cloning a date:

    //wrong way:
    var orig = new Date('10/1/2006');
    var copy = orig;
    copy.setDate(5);
    console.log(orig);  // returns 'Thu Oct 05 2006'!

    //correct way:
    var orig = new Date('10/1/2006'),
        copy = Ext.Date.clone(orig);
    copy.setDate(5);
    console.log(orig);  // returns 'Thu Oct 01 2006'

Get the numeric day number of the year, adjusted for leap year.

    @example
    var dt = new Date('9/17/2011');
    console.log(Ext.Date.getDayOfYear(dt)); // 259

Get the first day of the current month, adjusted for leap year.  The returned value
is the numeric day index within the week (0-6) which can be used in conjunction with
the <a href='#!/api/Ext.Date-property-monthNames'>monthNames</a> array to retrieve the textual day name.

     @example
     var dt = new Date('1/10/2007'),
         firstDay = Ext.Date.getFirstDayOfMonth(dt);
     console.log(Ext.Date.dayNames[firstDay]); // output: 'Monday'

Get the offset from GMT of the current date (equivalent to the format specifier 'O').

    @example
    var dt = new Date('9/17/2011');
    console.log(Ext.Date.getGMTOffset(dt));

Get the last day of the current month, adjusted for leap year.  The returned value
is the numeric day index within the week (0-6) which can be used in conjunction with
the <a href='#!/api/Ext.Date-property-monthNames'>monthNames</a> array to retrieve the textual day name.

     @example
     var dt = new Date('1/10/2007'),
         lastDay = Ext.Date.getLastDayOfMonth(dt);

     console.log(Ext.Date.dayNames[lastDay]); // output: 'Wednesday'

Get the timezone abbreviation of the current date (equivalent to the format specifier 'T').

__Note:__ The date string returned by the JavaScript Date object's `toString()` method varies
between browsers (e.g. FF vs IE) and system region settings (e.g. IE in Asia vs IE in America).
For a given date string e.g. "Thu Oct 25 2007 22:55:35 GMT+0800 (Malay Peninsula Standard Time)",
`getTimezone()` first tries to get the timezone abbreviation from between a pair of parentheses
(which may or may not be present), failing which it proceeds to get the timezone abbreviation
from the GMT offset portion of the date string.

    @example
    var dt = new Date('9/17/2011');
    console.log(Ext.Date.getTimezone(dt));

Get the numeric ISO-8601 week number of the year.
(equivalent to the format specifier 'W', but without a leading zero).

    @example
    var dt = new Date('9/17/2011');
    console.log(Ext.Date.getWeekOfYear(dt)); // 37

Returns a boolean indicating whether an object contains the specified property as a direct property
of that object and not inherited through the prototype chain.

Every object descended from <a href='#!/api/Object'>Object</a> inherits the <a href='#!/api/Ext.Date-method-hasOwnProperty'>hasOwnProperty</a> method. This method can be used
to determine whether an object has the specified property as a direct property of that object;
unlike the `in` operator, this method does not check down the object's prototype chain.

The following example determines whether the o object contains a property named prop:

    o = new Object();
    o.prop = 'exists';

    function changeO() {
        o.newprop = o.prop;
        delete o.prop;
    }

    o.hasOwnProperty('prop');   //returns true
    changeO();
    o.hasOwnProperty('prop');   //returns false

The following example differentiates between direct properties and properties inherited through the
prototype chain:

    o = new Object();
    o.prop = 'exists';
    o.hasOwnProperty('prop');             // returns true
    o.hasOwnProperty('toString');         // returns false
    o.hasOwnProperty('hasOwnProperty');   // returns false

The following example shows how to iterate over the properties of an object without executing on
inherit properties.

    var buz = {
        fog: 'stack'
    };

    for (var name in buz) {
        if (buz.hasOwnProperty(name)) {
            alert("this is fog (" + name + ") for sure. Value: " + buz[name]);
        }
        else {
            alert(name); // toString or something else
        }
    }

Checks if the current date falls within a leap year.

    @example
    var dt = new Date('1/10/2011');
    console.log(Ext.Date.isLeapYear(dt)); // false

Returns a boolean indication whether the specified object is in the prototype chain of the object
this method is called upon.

<a href='#!/api/Ext.Date-method-isPrototypeOf'>isPrototypeOf</a> allows you to check whether or not an object exists within another object's
prototype chain.

For example, consider the following prototype chain:

    function Fee() {
        // . . .
    }

    function Fi() {
        // . . .
    }
    Fi.prototype = new Fee();

    function Fo() {
        // . . .
    }
    Fo.prototype = new Fi();

    function Fum() {
        // . . .
    }
    Fum.prototype = new Fo();

Later on down the road, if you instantiate `Fum` and need to check if `Fi`'s prototype exists
within the `Fum` prototype chain, you could do this:

    var fum = new Fum();
    . . .

    if (Fi.prototype.isPrototypeOf(fum)) {
    // do something safe
    }

This, along with the `instanceof` operator particularly comes in handy if you have code that can
only function when dealing with objects descended from a specific prototype chain, e.g., to
guarantee that certain methods or properties will be present on that object.

Parses the passed string using the specified date format.
Note that this function expects normal calendar dates, meaning that months are 1-based (i.e. 1 = January).
The <a href='#!/api/Ext.Date-property-defaults'>defaults</a> hash will be used for any date value (i.e. year, month, day, hour, minute, second or millisecond)
which cannot be found in the passed string. If a corresponding default date value has not been specified in the <a href='#!/api/Ext.Date-property-defaults'>defaults</a> hash,
the current date's year, month, day or DST-adjusted zero-hour time value will be used instead.
Keep in mind that the input date string must precisely match the specified format string
in order for the parse operation to be successful (failed parse operations return a
<a href='#!/api/null'>null</a> value).

Example:

    //dt = Fri May 25 2007 (current date)
    var dt = new Date();

    //dt = Thu May 25 2006 (today&#39;s month/day in 2006)
    dt = Ext.Date.parse("2006", "Y");

    //dt = Sun Jan 15 2006 (all date parts specified)
    dt = Ext.Date.parse("2006-01-15", "Y-m-d");

    //dt = Sun Jan 15 2006 15:20:01
    dt = Ext.Date.parse("2006-01-15 3:20:01 PM", "Y-m-d g:i:s A");

    // attempt to parse Sun Feb 29 2006 03:20:01 in strict mode
    dt = Ext.Date.parse("2006-02-29 03:20:01", "Y-m-d H:i:s", true); // returns null

Returns a boolean indicating if the internal ECMAScript DontEnum attribute is set.

Every object has a <a href='#!/api/Ext.Date-method-propertyIsEnumerable'>propertyIsEnumerable</a> method. This method can determine whether the specified
property in an object can be enumerated by a `for...in` loop, with the exception of properties
inherited through the prototype chain. If the object does not have the specified property, this
method returns false.

The following example shows the use of <a href='#!/api/Ext.Date-method-propertyIsEnumerable'>propertyIsEnumerable</a> on objects and arrays:

    var o = {};
    var a = [];
    o.prop = 'is enumerable';
    a[0] = 'is enumerable';

    o.propertyIsEnumerable('prop');   // returns true
    a.propertyIsEnumerable(0);        // returns true

The following example demonstrates the enumerability of user-defined versus built-in properties:

    var a = ['is enumerable'];

    a.propertyIsEnumerable(0);          // returns true
    a.propertyIsEnumerable('length');   // returns false

    Math.propertyIsEnumerable('random');   // returns false
    this.propertyIsEnumerable('Math');     // returns false

Direct versus inherited properties

    var a = [];
    a.propertyIsEnumerable('constructor');         // returns false

    function firstConstructor()
    {
        this.property = 'is not enumerable';
    }
    firstConstructor.prototype.firstMethod = function () {};

    function secondConstructor()
    {
        this.method = function method() { return 'is enumerable'; };
    }

    secondConstructor.prototype = new firstConstructor;
    secondConstructor.prototype.constructor = secondConstructor;

    var o = new secondConstructor();
    o.arbitraryProperty = 'is enumerable';

    o.propertyIsEnumerable('arbitraryProperty');   // returns true
    o.propertyIsEnumerable('method');              // returns true
    o.propertyIsEnumerable('property');            // returns false

    o.property = 'is enumerable';

    o.propertyIsEnumerable('property');            // returns true

    // These return false as they are on the prototype which
    // propertyIsEnumerable does not consider (even though the last two
    // are iteratable with for-in)
    o.propertyIsEnumerable('prototype'); // returns false (as of JS 1.8.1/FF3.6)
    o.propertyIsEnumerable('constructor'); // returns false
    o.propertyIsEnumerable('firstMethod'); // returns false

Provides a convenient method for performing basic date arithmetic. This method
does not modify the Date instance being called - it creates and returns
a new Date instance containing the resulting date value.

Examples:

    // Basic usage:
    var dt = Ext.Date.subtract(new Date('10/29/2006'), Ext.Date.DAY, 5);
    console.log(dt); // returns 'Tue Oct 24 2006 00:00:00'

    // Negative values will be added:
    var dt2 = Ext.Date.subtract(new Date('10/1/2006'), Ext.Date.DAY, -5);
    console.log(dt2); // returns 'Fri Oct 6 2006 00:00:00'

     // Decimal values can be used:
    var dt3 = Ext.Date.subtract(new Date('10/1/2006'), Ext.Date.DAY, 1.25);
    console.log(dt3); // returns 'Fri Sep 29 2006 06:00:00'

 Specifies the function that creates an object's prototype.

 Returns a reference to the Object function that created the instance's prototype. Note that the
 value of this property is a reference to the function itself, not a string containing the
 function's name, but it isn't read only (except for primitive Boolean, Number or String values: 1,
 true, "read-only").

 All objects inherit a `constructor` property from their <a href='#!/api/Ext.Date-property-prototype'>prototype</a>:

     o = new Object // or o = {} in JavaScript 1.2
     o.constructor == Object
     a = new Array // or a = [] in JavaScript 1.2
     a.constructor == Array
     n = new Number(3)
     n.constructor == Number

 Even though you cannot construct most HTML objects, you can do comparisons. For example,

     document.constructor == Document
     document.form3.constructor == Form

 The following example creates a prototype, `Tree`, and an object of that type, theTree. The example then displays the `constructor` property for the object `theTree`.

     function Tree(name) {
         this.name = name;
     }
     theTree = new Tree("Redwood");
     console.log("theTree.constructor is " + theTree.constructor);

 This example displays the following output:

     theTree.constructor is function Tree(name) {
         this.name = name;
     }

 The following example shows how to modify constructor value of generic objects. Only true, 1 and
 "test" variable constructors will not be changed. This example explains that is not always so safe
 to believe in constructor function.

     function Type(){};
     var	types = [
 	    new Array,	[],
	    new Boolean,	true,
	    new Date,
	    new Error,
	    new Function,	function(){},
	    Math,
	    new Number,	1,
	    new Object,	{},
	    new RegExp,	/(?:)/,
	    new String,	"test"
     ];
     for(var i = 0; i < types.length; i++){
         types[i].constructor = Type;
         types[i] = [types[i].constructor, types[i] instanceof Type, types[i].toString()];
     };
     alert(types.join("\n"));

An array of textual day names.
Override these values for international dates.

Example:

    Ext.Date.dayNames = [
        'SundayInYourLang',
        'MondayInYourLang'
        // ...
    ];

An array of textual month names.
Override these values for international dates.

Example:

    Ext.Date.monthNames = [
        'JanInYourLang',
        'FebInYourLang'
        // ...
    ];

An object hash of zero-based JavaScript month numbers (with short month names as keys).

__Note:__ keys are case-sensitive.

Override these values for international dates.

Example:

    Ext.Date.monthNumbers = {
        'LongJanNameInYourLang': 0,
        'ShortJanNameInYourLang':0,
        'LongFebNameInYourLang':1,
        'ShortFebNameInYourLang':1
        // ...
    };
